"attributes":{"toolbar":{"id":"1358"}},"id":"1359","type":"ToolbarBox"},{"attributes":{},"id":"1485","type":"StringEditor"},{"attributes":{"text":"&lt;h1&gt;Strategy: MyStrategy&lt;/h1&gt;\n\n&lt;table class=\"metaDataTable\"&gt;\n&lt;thead&gt;\n&lt;tr&gt;\n  &lt;th&gt;Parameter&lt;/th&gt;\n  &lt;th&gt;Value&lt;/th&gt;\n&lt;/tr&gt;\n&lt;/thead&gt;\n&lt;tbody&gt;\n&lt;tr&gt;\n  &lt;td&gt;path_model&lt;/td&gt;\n  &lt;td&gt;bestRF&lt;em&gt;SQN&lt;/em&gt;ahead&lt;em&gt;8&lt;/em&gt;m_16.joblib&lt;/td&gt;\n&lt;/tr&gt;\n&lt;tr&gt;\n  &lt;td&gt;m&lt;/td&gt;\n  &lt;td&gt;16&lt;/td&gt;\n&lt;/tr&gt;\n&lt;tr&gt;\n  &lt;td&gt;stoptype&lt;/td&gt;\n  &lt;td&gt;5&lt;/td&gt;\n&lt;/tr&gt;\n&lt;tr&gt;\n  &lt;td&gt;trailpercent&lt;/td&gt;\n  &lt;td&gt;0.02&lt;/td&gt;\n&lt;/tr&gt;\n&lt;/tbody&gt;\n&lt;/table&gt;\n\n&lt;h2&gt;Indicators:&lt;/h2&gt;\n\n&lt;h3&gt;MyRFIndicator @                         Open     High      Low    Close  Volume&lt;/h3&gt;\n\n&lt;p&gt;&lt;DATE&gt;_&lt;TIME&gt; &lt;br /&gt;\n2019-01-02 06:00:00  1.14454  1.14469  1.14427  1.14454       0\n2019-01-02 07:00:00  1.14452  1.14788  1.14452  1.14787       0\n2019-01-02 08:00:00  1.14779  1.14967  1.14769  1.14853       0\n2019-01-02 09:00:00  1.14848  1.14928  1.14734  1.14761       0\n2019-01-02 10:00:00  1.14760  1.14776  1.14282  1.14477       0\n...                      ...      ...      ...      ...     ...\n2019-06-28 19:00:00  1.13742  1.13756  1.13501  1.13584       0\n2019-06-28 20:00:00  1.13584  1.13686  1.13552  1.13684       0\n2019-06-28 21:00:00  1.13684  1.13776  1.13653  1.13766       0\n2019-06-28 22:00:00  1.13765  1.13766  1.13692  1.13713       0\n2019-06-28 23:00:00  1.13712  1.13713  1.13660  1.13693       0&lt;/p&gt;\n\n&lt;p&gt;[3063 rows x 5 columns]&lt;/p&gt;\n\n&lt;table class=\"metaDataTable\"&gt;\n&lt;thead&gt;\n&lt;tr&gt;\n  &lt;th&gt;Parameter&lt;/th&gt;\n  &lt;th&gt;Value&lt;/th&gt;\n&lt;/tr&gt;\n&lt;/thead&gt;\n&lt;tbody&gt;\n&lt;tr&gt;\n  &lt;td&gt;period&lt;/td&gt;\n  &lt;td&gt;16&lt;/td&gt;\n&lt;/tr&gt;\n&lt;tr&gt;\n  &lt;td&gt;path_model&lt;/td&gt;\n  &lt;td&gt;bestRF&lt;em&gt;SQN&lt;/em&gt;ahead&lt;em&gt;8&lt;/em&gt;m_16.joblib&lt;/td&gt;\n&lt;/tr&gt;\n&lt;tr&gt;\n  &lt;td&gt;m&lt;/td&gt;\n  &lt;td&gt;16&lt;/td&gt;\n&lt;/tr&gt;\n&lt;/tbody&gt;\n&lt;/table&gt;\n\n&lt;p&gt;Source Code:&lt;/p&gt;\n\n&lt;pre&gt;&lt;code&gt;class MyStrategy(bt.Strategy):\n    params = (('path_model', 'bestRF_SQN_ahead_8_m_16.joblib'),\n              ('m', 16),\n              ('stoptype', bt.Order.StopTrail),\n              ('trailpercent',0.000))  # price is 2% less than the entry point\n\n\n    def __init__(self):          \n        self.lines.rf = MyRFIndicator(self.data, path_model=self.p.path_model, m=self.p.m)\n        self.ahead_time = 8\n        self.timeIni = None \n#         self.order = None\n\n    def notify_order(self, order):\n        ''' \u00bfPor qu\u00e9 usar notify_order?\n        Porque esto asegura que la orden que debe ser controlada por el Stop realmente se ha ejecutado. Esto puede no ser un gran problema \n        durante las pruebas de backtesting, pero lo es cuando se opera en vivo.   \n        ''' \n        if not order.status == order.Completed:\n            return  # discard any other notification\n\n        if not self.position:  # we left the market\n            print('SELL@price: {:.2f}'.format(order.executed.price))\n            return\n\n        # We have entered the market\n        print('BUY @price: {:.2f}'.format(order.executed.price))\n\n\n\n    def next(self):       \n        if not self.position:  # not in the market\n            self.timeIni = len(self.data)\n\n            if self.lines.rf[0] == 1:                 \n                size = int(self.broker.get_cash() / self.data)\n                self.buy(size=size)\n                # Stop trail       \n#                 self.buy(size=size, exectype=self.p.stoptype, trailpercent=self.p.trailpercent)\n#                 self.sell(size=size, exectype=self.p.stoptype, trailpercent=self.p.trailpercent)\n\n            # print('COMPRO!')                \n            elif self.lines.rf[0] == 0:\n                size = int(self.broker.get_cash() / self.data)\n                self.sell(size=size)\n#                 self.sell(size=size, exectype=self.p.stoptype, trailpercent=self.p.trailpercent)\n                # Stop trail       \n#                 self.buy(size=size, exectype=self.p.stoptype, trailpercent=self.p.trailpercent)\n\n#                 print('VENDO!')                        \n        elif self.position:  # in the market\n            if len(self.data) &amp;gt; self.timeIni + self.ahead_time:\n                self.close()  # close long position\n\n&lt;/code&gt;&lt;/pre&gt;\n\n&lt;hr /&gt;\n\n&lt;h1&gt;Data Feeds&lt;/h1&gt;\n\n&lt;h2&gt;PandasData&lt;/h2&gt;\n\n&lt;table class=\"metaDataTable\"&gt;\n&lt;thead&gt;\n&lt;tr&gt;\n  &lt;th&gt;Property&lt;/th&gt;\n  &lt;th&gt;Value&lt;/th&gt;\n&lt;/tr&gt;\n&lt;/thead&gt;\n&lt;tbody&gt;\n&lt;tr&gt;\n  &lt;td&gt;DataName:&lt;/td&gt;\n  &lt;td&gt;Open     High      Low    Close  Volume&lt;/td&gt;\n&lt;/tr&gt;\n&lt;/tbody&gt;\n&lt;/table&gt;\n\n&lt;p&gt;&lt;DATE&gt;_&lt;TIME&gt; &lt;br /&gt;\n2019-01-02 06:00:00  1.14454  1.14469  1.14427  1.14454       0\n2019-01-02 07:00:00  1.14452  1.14788  1.14452  1.14787       0\n2019-01-02 08:00:00  1.14779  1.14967  1.14769  1.14853       0\n2019-01-02 09:00:00  1.14848  1.14928  1.14734  1.14761       0\n2019-01-02 10:00:00  1.14760  1.14776  1.14282  1.14477       0\n...                      ...      ...      ...      ...     ...\n2019-06-28 19:00:00  1.13742  1.13756  1.13501  1.13584       0\n2019-06-28 20:00:00  1.13584  1.13686  1.13552  1.13684       0\n2019-06-28 21:00:00  1.13684  1.13776  1.13653  1.13766       0\n2019-06-28 22:00:00  1.13765  1.13766  1.13692  1.13713       0\n2019-06-28 23:00:00  1.13712  1.13713  1.13660  1.13693       0&lt;/p&gt;\n\n&lt;p&gt;[3063 rows x 5 columns]|\n|Timezone:|None|\n|Number of bars:|3063|\n|Bar Length:|1
